# %% [markdown]
# **Split Predictors and Target**

# %%
y=titanic_train.loc[:,'Survived']
X=titanic_train.drop(['Survived'],axis=1)

# %%
params={
    'num_impute_strategy':'median',
    'num_fill_value':'NA',
    'cat_impute_strategy':'most_frequent',
    'lr_penalty': 'l2',
    'logistic_solver':'lbfgs',
    'random_state':0,
    'max_iter':200,
    'dt_criterion':'gini',
    'dt_max_depth':6,
    'dt_min_samples_split':2,
    'dt_min_samples_leaf':1,
    'rf_criterion':'gini',
    'rf_max_depth':5,
    'rf_min_samples_split':2,
    'rf_min_samples_leaf':1,
    'cv_folds':8
}

# %% [markdown]
# ### **Preprocessing**

# %%
# Columns to drop
cols_to_drop=['PassengerId','Name','Ticket','Cabin']

# %%
# Separate numerical and categorical columns
num_cols=[col for col in X.columns if X[col].dtype in ['int32','int64','float32','float64'] and col not in cols_to_drop]
cat_cols=[col for col in X.columns if X[col].dtype=='object' and col not in cols_to_drop]

# %%
print(num_cols)
print(cat_cols)

# %% [markdown]
# **Impute missing values for numerical columns**

# %%
# Initialize SimpleImputer to impute missing values for numerical columns
if params.get('num_impute_strategy')=='constant':
    numerical_imputer=SimpleImputer(strategy=params.get('num_impute_strategy'),fill_value=params.get('num_fill_value'))
else:
    numerical_imputer=SimpleImputer(strategy=params.get('num_impute_strategy'))

# %% [markdown]
# **Numerical Pipeline Steps**

# %%
numerical_pipeline=Pipeline(steps=[
    ('numerical_imputer',numerical_imputer),
])

# %% [markdown]
# **Impute missing values for categorical variables**

# %%
# Initialize SimpleImputer to impute missing values for categorical columns
categorical_imputer=SimpleImputer(strategy=params.get('cat_impute_strategy'))

# %% [markdown]
# **Encode categorical variables**

# %%
# Initialize OneHotEncoder to encode categorical variables
cat_encoder=OneHotEncoder(handle_unknown='ignore',sparse_output=False)

# %% [markdown]
# **Categorical Pipeline Steps**

# %%
categorical_pipeline=Pipeline(steps=[
    ('categorical_imputer',categorical_imputer),
    ('categorical_encoder',cat_encoder)
])

# %% [markdown]
# **Combine Numerical and Categorical Pipelines**

# %%
# Combine Numerical and categorical Pipeline steps using ColumnTransformer
preprocessor=ColumnTransformer(transformers=[
    ('numerical_pipeline',numerical_pipeline,num_cols),
    ('categorical_pipeline',categorical_pipeline,cat_cols)
])


# %% [markdown]
# ### **Feature Extraction**

# %% [markdown]
# **Combine `Parch` and `SibSp` columns into a single column `Family_Members` with total number of family members**

# %%
class FamilyMembers(BaseEstimator,TransformerMixin):
    def fit(self,X,y=None):
        return self

    def transform(self,X):
        X_=pd.DataFrame(X,columns=['Pclass','Age','SibSp','Parch','Fare','Sex_female','Sex_male','Embarked_C','Embarked_Q','Embarked_S'])
        X_['Family_Members']=X_['Parch']+X_['SibSp']
        return X_


# %%
# Initialize Custom Transformer FamilyMembers
family_members=FamilyMembers()


# %% [markdown]
# **Extract `Travelling_Alone` from `Parch` and `SibSp` columns**

# %%
class TravellingAlone(BaseEstimator,TransformerMixin):
    def fit(self,X,y=None):
        return self

    def transform(self,X):
        X_=pd.DataFrame(X,columns=['Pclass','Age','SibSp','Parch','Fare','Sex_female','Sex_male','Embarked_C','Embarked_Q','Embarked_S','Family_Members'])
        X_.loc[(X_['SibSp']==0)|(X_['Parch']==0),'Travelling_Alone']=1
        X_.loc[(X_['SibSp']>0)|(X_['Parch']>0),'Travelling_Alone']=0
        return X_



# %%
# Initialize Custom Transformer TravellingAlone
travelling_alone=TravellingAlone()


# %% [markdown]
# **Transform `Age` column into different `Age_Groups`**

# %%
class AgeGroups(BaseEstimator,TransformerMixin):
    def fit(self,X,y=None):
        return self

    def transform(self,X):
        X_=pd.DataFrame(X,columns=['Pclass','Age','SibSp','Parch','Fare','Sex_female','Sex_male','Embarked_C','Embarked_Q','Embarked_S','Family_Members','Travelling_Alone'])
        X_.loc[(X_['Age']>0)&(X_['Age']<18),'Age_Groups']=0
        X_.loc[(X_['Age']>=18)&(X_['Age']<36),'Age_Groups']=1
        X_.loc[(X_['Age']>=36)&(X_['Age']<54),'Age_Groups']=2
        X_.loc[(X_['Age']>=54)&(X_['Age']<72),'Age_Groups']=3
        X_.loc[(X_['Age']>=72)&(X_['Age']<90),'Age_Groups']=4
        X_.loc[(X_['Age']>=90),'Age_Groups']=5
        return X_


# %%
# Initialize Custom Transformer AgeGroups
age_groups=AgeGroups()


# %% [markdown]
# **Perform Log1p transformation on `Fare` and categorize into `Fare_Class` column**

# %%
class FareClass(BaseEstimator,TransformerMixin):
    def fit(self,X,y=None):
        return self

    def transform(self,X):
        X_=pd.DataFrame(X,columns=['Pclass','Fare','Age','SibSp','Parch','Fare','Sex_female','Sex_male','Embarked_C','Embarked_Q','Embarked_S','Family_Members','Travelling_Alone','Age_Groups'])
        X_['Fare']=np.log1p(X_['Fare'].values).astype('int64')
        return X_


# %%
# Initialize Custom Transformer FareClass
fare_class=FareClass()


# %% [markdown]
# ### **Feature Selection**

# %%
class SelectFeatures(BaseEstimator,TransformerMixin):
    def __init__(self,columns):
        self.columns=columns

    def fit(self,X,y=None):
        return self

    def transform(self,X):
        return X.loc[:,self.columns]


# %%
# Initialize Custom Transformer SelectFeatures
select_features=SelectFeatures(['Pclass','Fare','Sex_female','Sex_male','Embarked_C','Embarked_Q','Embarked_S','Family_Members','Travelling_Alone','Age_Groups'])

# %% [markdown]
# **Feature Pipeline Steps**

# %%
feature_pipeline=Pipeline(steps=[
    ('family_members',family_members),
    ('travelling_alone',travelling_alone),
    ('age_groups',age_groups),
    ('feature_selection',select_features)
])

# %% [markdown]
# ### **Models**

# %% [markdown]
# **Logistic Regression Model**

# %%
lr_run_name='Logistic Regression_CV'
if params.get('lr_penalty')=='None' and params.get('logistic_solver') in ['lbfgs','newton-cg','newton-cholesky','sag','saga']:
    lr=LogisticRegression(penalty=None,
                          solver=params.get('logistic_solver'),
                          random_state=params.get('random_state'),
                          max_iter=params.get('max_iter'))
else:
    lr=LogisticRegression(penalty=params.get('lr_penalty'),
                          solver=params.get('logistic_solver'),
                          random_state=params.get('random_state'),
                          max_iter=params.get('max_iter'))

# %% [markdown]
# **Decision Tree Model**

# %%
dt_run_name='Decision Tree Classifier_CV'
dt=DecisionTreeClassifier(criterion=params.get('dt_criterion'),
                          max_depth=params.get('dt_max_depth'),
                          min_samples_split=params.get('dt_min_samples_split'),
                          min_samples_leaf=params.get('dt_min_samples_leaf'))

# %% [markdown]
# **Random Forest Model**

# %%
rf_run_name='Random Forest Classifier_CV'
rf=RandomForestClassifier(criterion=params.get('rf_criterion'),
                          max_depth=params.get('rf_max_depth'),
                          min_samples_split=params.get('rf_min_samples_split'),
                          min_samples_leaf=params.get('rf_min_samples_leaf'))

# %% [markdown]
# **XGBoost**

# %%
xg_run_name='xgboost_CV'
xgboost=XGBClassifier(tree_method='hist')

# %% [markdown]
# ### **Pipeline**

# %% [markdown]
# **Define Pipeline Steps**

# %%
pipeline=Pipeline(steps=[
    ('preprocessor',preprocessor),
    ('features',feature_pipeline),
    ('model',rf)
])

# %% [markdown]
# ### **Cross-validation**

# %%
cv_scores=cross_validate(pipeline,X,y,scoring=['accuracy','precision','recall','f1','roc_auc'],cv=params.get('cv_folds'))

# %% [markdown]
# **Model Metrics**

# %%
cv_scores

# %%
# Accuracy
avg_accuracy=round(cv_scores['test_accuracy'].mean(),3)
print(f'Cross Validation Accuracy={avg_accuracy}')

# Precision
avg_precision=round(cv_scores['test_precision'].mean(),3)
print(f'Cross Validation Precision={avg_precision}')

# Recall
avg_recall=round(cv_scores['test_recall'].mean(),3)
print(f'Cross Validation Recall={avg_recall}')

# F1-score
avg_f1=round(cv_scores['test_f1'].mean(),3)
print(f'Cross Validation F1-score={avg_f1}')

# ROC AUC
avg_roc_auc=round(cv_scores['test_roc_auc'].mean(),3)
print(f'Cross Validation ROC AUC={avg_roc_auc}')

# %% [markdown]
# ### **Log the model in MLFlow**

# %%
with mlflow.start_run(run_name=rf_run_name):
    pipeline.fit(X,y)
    mlflow.log_params(params)
    mlflow.log_metrics({'accuracy':avg_accuracy,'precision':avg_precision,'recall':avg_recall,'f1':avg_f1,'roc_auc':avg_roc_auc})
    signature=mlflow.models.infer_signature(X,y,params)
    mlflow.sklearn.log_model(sk_model=pipeline,artifact_path=rf_run_name,signature=signature,registered_model_name=rf_run_name)


